import React from "react";

const foodList = [
  { name : "kimbap" },
  { name : "bokkumbap" },
  { name : "samgyupsal" },
]

function Food ({name, picture}) {
  return <div>I like {name}</div>
}

function renderFood (dish) {
  return <Food name={dish.name} />;
}

function App() {
  return ( 
    <div>
      {foodList.map(meal => (
        <Food name={meal.name} />
      ))}
      {console.log(foodList.map(renderFood))}
    </div>
  );
}

export default App;
